import { Container } from "react-bootstrap";
import Footer from "../Components/Footer";
import Header from "../Components/Header";

function Reports() {
    return(
        <div className="App">
            <Header />
            <div className="content">
                <Container>
                    <h1>Reports Page</h1>
                </Container>

            </div>
            <Footer />
        </div>
    )
}

export default Reports;
